Maghanda lamang ng alinman sa mga sumusunod na proof of co-morbidity:

-Medical certificate (sa loob ng 18 na buwan);
-Prescription ng maintenance na gamot (sa loob ng 6 na buwan);
-Hospital records tulad ng discharge summary o medical abstract; o
-Surgical at pathology records

Para po sa mga may co-morbidity ay maghanda lamang ng alinman sa mga sumusunod na proof of co-morbidity:

-Medical certificate (sa loob ng 18 na buwan);
-Prescription ng maintenance na gamot (sa loob ng 6 na buwan);

